k8s clients have the type k8s.io/client-go/kubernetes.ClientSet which is actually a high-level client set facade encapsulating clients for the core, appsv1, discoveryv1, eventsv1, networkingv1, nodev1, policyv1, storagev1 api groups. These individual clients are available via accessor methods. ie use clientset.AppsV1() to get the the AppsV1 client. // Clientset contains the clients for groups. Each group has exactly one
// version included in a Clientset.
type Clientset struct { appsV1 *appsv1.AppsV1Client coreV1 *corev1.CoreV1Client discoveryV1 *discoveryv1.DiscoveryV1Client eventsV1 *eventsv1.EventsV1Client // ... // AppsV1 retrieves the AppsV1Client func (c *Clientset) AppsV1() appsv1.AppsV1Interface { return c.appsV1 } // ...
} As can be noticed from the above snippet, each of these clients associated with api groups expose an interface named GroupVersionInterface that in-turn provides further access to a generic REST Interface as well as access to a typed interface containing getter/setter methods for objects within that API group. For example EventsV1Client which is used to interact with features provided by the events.k8s.io group implements EventsV1Interface type EventsV1Interface interface { RESTClient() rest.Interface // generic REST API access EventsGetter // typed interface access
}
// EventsGetter has a method to return a EventInterface.
type EventsGetter interface { Events(namespace string) EventInterface
} The ClientSet struct implements the kubernetes.Interface facade which is a high-level facade containing all the methods to access the individual GroupVersionInterface facade clients. type Interface interface { Discovery() discovery.DiscoveryInterface AppsV1() appsv1.AppsV1Interface CoreV1() corev1.CoreV1Interface EventsV1() eventsv1.EventsV1Interface NodeV1() nodev1.NodeV1Interface // ... other facade accessor
} One can generate k8s clients for custom k8s objects that follow the same pattern for core k8s objects. The details are not covered here. Please refer to How to generate client codes for Kubernetes Custom Resource Definitions , gengo , k8s.io codegenrator and the slightly-old article: Kubernetes Deep Dive: Code Generation for CustomResources

