The basic workqueue.Interface has the following methods: type Interface interface { Add(item interface{}) Len() int Get() (item interface{}, shutdown bool) Done(item interface{}) ShutDown() ShutDownWithDrain() ShuttingDown() bool
} This is extended with ability to Add Item as a later time using the workqueue.DelayingInterface . type DelayingInterface interface { Interface // AddAfter adds an item to the workqueue after the indicated duration has passed // Used to requeue items after failueres to avoid ending in hot-loop AddAfter(item interface{}, duration time.Duration)
} This is further extended with rate limiting using workqueue.RateLimiter type RateLimiter interface { // When gets an item and gets to decide how long that item should wait When(item interface{}) time.Duration // Forget indicates that an item is finished being retried. Doesn't matter whether its for perm failing // or for success, we'll stop tracking it Forget(item interface{}) // NumRequeues returns back how many failures the item has had NumRequeues(item interface{}) int
}

