Machine is the representation of a physical or virtual machine that corresponds to a front-end k8s node object. An example YAML looks like the below apiVersion: machine.sapcloud.io/v1alpha1
kind: Machine
metadata: name: test-machine namespace: default
spec: class: kind: MachineClass name: test-class pkg/apis/machine/v1alpha1.Machine A Machine has a Spec field represented by MachineSpec type Machine struct { // ObjectMeta for machine object metav1.ObjectMeta // TypeMeta for machine object metav1.TypeMeta // Spec contains the specification of the machine Spec MachineSpec // Status contains fields depicting the status Status MachineStatus } graph TB subgraph Machine ObjectMeta TypeMeta MachineSpec MachineStatus end MachineSpec MachineSpec represents the specification of a Machine. type MachineSpec struct { // Class is the referrent to the MachineClass. Class ClassSpec // Unique identification of the VM at the cloud provider ProviderID string // NodeTemplateSpec describes the data a node should have when created from a template NodeTemplateSpec NodeTemplateSpec // Configuration for the machine-controller. *MachineConfiguration }
type NodeTemplateSpec struct { // BADLY NAMED! metav1.ObjectMeta // NodeSpec describes the attributes that a node is created with. Spec corev1.NodeSpec
} ProviderID is the unique identification of the VM at the cloud provider. ProviderID typically matches with the node.Spec.ProviderID on the node object. Class field is of type ClassSpec which is just the (Kind and the Name) referring to the MachineClass. (Ideally the field, type should have been called ClassReference) like OwnerReference NodeTemplateSpec describes the data a node should have when created from a template, embeds ObjectMeta and holds a corev1.NodeSpec in its Spec field. The Machine.Spec.NodeTemplateSpec.Spec mirrors k8s Node.Spec MachineSpec embeds a MachineConfiguration which is just a configuration object that is a connection of timeouts, maxEvictRetries and NodeConditions graph TB subgraph MachineSpec Class:ClassSpec ProviderID:string NodeTemplateSpec:NodeTemplateSpec MachineConfiguration end type MachineConfiguration struct { // MachineDraintimeout is the timeout after which machine is forcefully deleted. MachineDrainTimeout *Duration // MachineHealthTimeout is the timeout after which machine is declared unhealhty/failed. MachineHealthTimeout *Duration // MachineCreationTimeout is the timeout after which machinie creation is declared failed. MachineCreationTimeout *Duration // MaxEvictRetries is the number of retries that will be attempted while draining the node. MaxEvictRetries *int32 // NodeConditions are the set of conditions if set to true for MachineHealthTimeOut, machine will be declared failed. NodeConditions *string } MachineStatus pkg/apis/machine/v1alpha1.MachineStatus represents the most recently observed status of Machine. type MachineStatus struct { // Node string. Node string // TODO: describe me more // Conditions of this machine, same as NodeStatus.Conditions Conditions []NodeCondition // Last operation refers to the status of the last operation performed. NOTE: this is usually the NextOperation for reconcile!! Discuss! LastOperation LastOperation // Current status of the machine object CurrentStatus CurrentStatus // LastKnownState can store details of the last known state of the VM by the plugins. // It can be used by future operation calls to determine current infrastucture state LastKnownState string } Extended NodeConditionTypes The MCM extends standard k8s NodeConditionType with several custom conditions. (TODO: isn't this hacky/error prone?) NodeTerminationCondition defined as NodeTerminationCondition v1.NodeConditionType = "Terminating" NodeTerminationCondition LastOperation github.com/machine-controller-manager/pkg/apis/machine/v1alpha1.LastOperation represents the last operation performed on the object type LastOperation struct { // Description of the operation Description string // Last update time of operation LastUpdateTime Time // State of operation (bad naming) State MachineState // Type of operation Type MachineOperationType } MachineState (should be called MachineOperationState) NOTE: BADLY NAMED: Should be called MachineOperationState machine-controller-manager/pkg/apis/machine/v1alpha1.MachineState represents the current state of a machine operation and is one of Processing, Failed or Successful. // MachineState is current state of the machine.
// BAD Name: Should be MachineOperationState
type MachineState string // These are the valid (operation) states of machines.
const ( // MachineStatePending means there are operations pending on this machine state MachineStateProcessing MachineState = "Processing" // MachineStateFailed means operation failed leading to machine status failure MachineStateFailed MachineState = "Failed" // MachineStateSuccessful indicates that the node is not ready at the moment MachineStateSuccessful MachineState = "Successful"
) MachineOperationType github.com/machine-controller-manager/pkg/apis/machine/v1alpha1.MachineOperationType is a label for the operation performed on a machine object: Create/Update/HealthCheck/Delete. type MachineOperationType string
const ( // MachineOperationCreate indicates that the operation is a create MachineOperationCreate MachineOperationType = "Create" // MachineOperationUpdate indicates that the operation is an update MachineOperationUpdate MachineOperationType = "Update" // MachineOperationHealthCheck indicates that the operation is a create MachineOperationHealthCheck MachineOperationType = "HealthCheck" // MachineOperationDelete indicates that the operation is a delete MachineOperationDelete MachineOperationType = "Delete"
) CurrentStatus github.com/machine-controller-manager/pkg/apis/machine/v1alpha1.CurrentStatus encapsulates information about the current status of Machine. type CurrentStatus struct { // Phase refers to the Machien (Lifecycle) Phase Phase MachinePhase // TimeoutActive when set to true drives the machine controller // to check whether	machine failed the configured creation timeout or health check timeout and change machine phase to Failed. TimeoutActive bool // Last update time of current status LastUpdateTime Time
} MachinePhase MachinePhase is a label for the life-cycle phase of a machine at a given time: Unknown, Pending, Available, Running, Terminating, Failed, CrashLoopBackOff,. type MachinePhase string
const ( // MachinePending means that the machine is being created MachinePending MachinePhase = "Pending" // MachineAvailable means that machine is present on provider but hasn't joined cluster yet MachineAvailable MachinePhase = "Available" // MachineRunning means node is ready and running successfully MachineRunning MachinePhase = "Running" // MachineRunning means node is terminating MachineTerminating MachinePhase = "Terminating" // MachineUnknown indicates that the node is not ready at the movement MachineUnknown MachinePhase = "Unknown" // MachineFailed means operation failed leading to machine status failure MachineFailed MachinePhase = "Failed" // MachineCrashLoopBackOff means creation or deletion of the machine is failing. MachineCrashLoopBackOff MachinePhase = "CrashLoopBackOff"
) Finalizers See K8s Finalizers . The MC defines the following finalizer keys const ( MCMFinalizerName = "machine.sapcloud.io/machine-controller-manager" MCFinalizerName = "machine.sapcloud.io/machine-controller"
) MCMFinalizerName is the finalizer used to tag dependecies before deletion MCFinalizerName is the finalizer added on Secret objects.

