permits.PermitGiver permits.PermitGiver provides the ability to register, obtain, release and delete permits for a given key. All operations are concurrent safe. type PermitGiver interface { RegisterPermits(key string, numPermits int) //numPermits should be maxNumPermits TryPermit(key string, timeout time.Duration) bool ReleasePermit(key string) DeletePermits(key string) Close()
} The implementation of github.com/gardener/machine-controller-manager/pkg/util/permits.PermitGiver maintains: a sync map of permit keys mapped to permits, where each permit is a structure comprising a buffered empty struct struct{} channel with buffer size equalling the (max) number of permits. RegisterPermits(key, numPermits) registers numPermits for the given key. A permit struct is initialized with permit.c buffer size as numPermits. entries are deleted if not accessed for a configured time represented by stalePermitKeyTimeout. This is done by 'janitor' go-routine associated with the permit giver instance. When attempting to get a permit, one writes an empty struct to the permit channel within a given timeout. If one can do so within the timeout one has acquired the permit, else not. TryPermit(key, timeout) attempts to get a permit for the given key by sending a struct{}{} instance to the buffered permit.c channel. type permit struct { // lastAcquiredPermitTime is time since last successful TryPermit or new RegisterPermits lastAcquiredPermitTime time.Time // c is initialized with buffer size N representing num permits c chan struct{} }
type permitGiver struct { keyPermitsMap sync.Map // map of string keys to permit struct values stopC chan struct{}
} permits.NewPermitGiver permits.NewPermitGiver returns a new PermitGiver func NewPermitGiver(stalePermitKeyTimeout time.Duration, janitorFrequency time.Duration) PermitGiver %%{init: {'themeVariables': { 'fontSize': '10px'}, "flowchart": {"useMaxWidth": false }}}%% flowchart TB Begin((" ")) --&gt;InitStopCh["stopC := make(chan struct{})"] --&gt;InitPG[" pg := permitGiver{ keyPermitsMap: sync.Map{}, stopC: stopC, }"] --&gt;LaunchCleanUpGoroutine["go cleanup()"] LaunchCleanUpGoroutine--&gt;Return(("return &amp;pg")) LaunchCleanUpGoroutine---&gt;InitTicker subgraph cleanup InitTicker["ticker := time.NewTicker(janitorFrequency)"] --&gt;caseReadStopCh{"&lt;-stopC ?"} caseReadStopCh--Yes--&gt;End(("End")) caseReadStopCh--No --&gt;ReadTickerCh{"&lt;-ticker.C ?"} ReadTickerCh--Yes--&gt;CleanupStale[" pg.cleanupStalePermitEntries(stalePermitKeyTimeout) (Iterates keyPermitsMap, remove entries whose lastAcquiredPermitTime exceeds stalePermitKeyTimeout) "] ReadTickerCh--No--&gt;caseReadStopCh end

