machine-controller-manager/pkg/util/provider/app/options.MCServer is the main server context object for the machine controller. It embeds options.MachineControllerConfiguration and has a ControlKubeConfig and TargetKubeConfig string fields. type MCServer struct { options.MachineControllerConfiguration ControlKubeconfig string TargetKubeconfig string The MCServer is constructed and initialized using the pkg/util/provider/app/options.NewMCServer function which sets most of the default values for fields for the embedded struct. MCServer Usage Individual providers leverage the MCServer as follows: s := options.NewMCServer() driver := <providerSpecificDriverInitialization> if err := app.Run(s, driver); err != nil { fmt.Fprintf(os.Stderr, "%v\n", err) os.Exit(1) } The MCServer is thus re-used across different providers. MachineControllerConfiguration struct An imnportant struct that represents machine configuration that supports deep-coopying and is embedded within the MCServer machine-controller-manager/pkg/util/provider/options.MachineControllerConfiguration type MachineControllerConfiguration struct { metav1.TypeMeta // namespace in seed cluster in which controller would look for the resources. Namespace string // port is the port that the controller-manager's http service runs on. Port int32 // address is the IP address to serve on (set to 0.0.0.0 for all interfaces). Address string // CloudProvider is the provider for cloud services. CloudProvider string // ConcurrentNodeSyncs is the number of node objects that are // allowed to sync concurrently. Larger number = more responsive nodes, // but more CPU (and network) load. ConcurrentNodeSyncs int32 // enableProfiling enables profiling via web interface host:port/debug/pprof/ EnableProfiling bool // enableContentionProfiling enables lock contention profiling, if enableProfiling is true. EnableContentionProfiling bool // contentType is contentType of requests sent to apiserver. ContentType string // kubeAPIQPS is the QPS to use while talking with kubernetes apiserver. KubeAPIQPS float32 // kubeAPIBurst is the burst to use while talking with kubernetes apiserver. KubeAPIBurst int32 // leaderElection defines the configuration of leader election client. LeaderElection mcmoptions.LeaderElectionConfiguration // How long to wait between starting controller managers ControllerStartInterval metav1.Duration // minResyncPeriod is the resync period in reflectors; will be random between // minResyncPeriod and 2*minResyncPeriod. MinResyncPeriod metav1.Duration // SafetyOptions is the set of options to set to ensure safety of controller SafetyOptions SafetyOptions //NodeCondition is the string of known NodeConditions. If any of these NodeCondition is set for a timeout period, the machine will be declared failed and will replaced. Default is "KernelDeadlock,ReadonlyFilesystem,DiskPressure,NetworkUnavailable" NodeConditions string //BootstrapTokenAuthExtraGroups is a comma-separated string of groups to set bootstrap token's "auth-extra-groups" field to. BootstrapTokenAuthExtraGroups string
} SafetyOptions An important struct availablea as the SafetyOptions field in MachineControllerConfiguration containing several timeouts, retry-limits, etc. Most of these fields are set via pkg/util/provider/app/options.NewMCServer function pkg/util/provider/option.SafetyOptions // SafetyOptions are used to configure the upper-limit and lower-limit
// while configuring freezing of machineSet objects
type SafetyOptions struct { // Timeout (in durartion) used while creation of // a machine before it is declared as failed MachineCreationTimeout metav1.Duration // Timeout (in durartion) used while health-check of // a machine before it is declared as failed MachineHealthTimeout metav1.Duration // Maximum number of times evicts would be attempted on a pod for it is forcibly deleted // during draining of a machine. MaxEvictRetries int32 // Timeout (in duration) used while waiting for PV to detach PvDetachTimeout metav1.Duration // Timeout (in duration) used while waiting for PV to reattach on new node PvReattachTimeout metav1.Duration // Timeout (in duration) for which the APIServer can be down before // declare the machine controller frozen by safety controller MachineSafetyAPIServerStatusCheckTimeout metav1.Duration // Period (in durartion) used to poll for orphan VMs // by safety controller MachineSafetyOrphanVMsPeriod metav1.Duration // Period (in duration) used to poll for APIServer's health // by safety controller MachineSafetyAPIServerStatusCheckPeriod metav1.Duration // APIserverInactiveStartTime to keep track of the // start time of when the APIServers were not reachable APIserverInactiveStartTime time.Time // MachineControllerFrozen indicates if the machine controller // is frozen due to Unreachable APIServers MachineControllerFrozen bool
}

