(OPINION: I beleive this is a minor NIH design defect. Ideally one should have re-levaraged the k8s API machinery Status k8s.io/apimachinery/pkg/apis/meta/v1.Status instead of making custom status object.) status implements errors returned by MachineAPIs. MachineAPIs service handlers should return an error created by this package, and machineAPIs clients should expect a corresponding error to be returned from the RPC call. status.Status implements error and encapsulates a code which should be onf the codes in codes.Code and a develoer-facing error message in English type Status struct { code int32 message string
}
// New returns a Status encapsulating code and msg.
func New(code codes.Code, msg string) *Status { return &Status{code: int32(code), message: msg}
} NOTE: No ideally why we are doing such hard work as shown in status.FromError which involves time-consuming regex parsing of an error string into a status. This is actually being used to parse error strings of errors returned by Driver methods. Not good - should be better designed.

