the machine controller is constructed using machine-controller-manager/pkg/util/provider/machinecontroller/controller.newcontroller factory function which initializes the controller struct. 1. newcontroller factory func mc is constructed using the factory function below: func newcontroller( namespace string, controlmachineclient machineapi.machinev1alpha1interface, controlcoreclient kubernetes.interface, targetcoreclient kubernetes.interface, driver driver.driver, pvcinformer coreinformers.persistentvolumeclaiminformer, pvinformer coreinformers.persistentvolumeinformer, secretinformer coreinformers.secretinformer, nodeinformer coreinformers.nodeinformer, pdbinformer policyinformers.poddisruptionbudgetinformer, volumeattachmentinformer storageinformers.volumeattachmentinformer, machineclassinformer machineinformers.machineclassinformer, machineinformer machineinformers.machineinformer, recorder record.eventrecorder, safetyoptions options.safetyoptions, nodeconditions string, bootstraptokenauthextragroups string,
) (controller, error) { // etc } 1.1 create controller struct create the controller struct initializing rate-limiting work queues for all relevant resources controller := &controller{ namespace: namespace, controlmachineclient: controlmachineclient, controlcoreclient: controlcoreclient, targetcoreclient: targetcoreclient, recorder: recorder, secretqueue: workqueue.newnamedratelimitingqueue(workqueue.defaultcontrollerratelimiter(), "secret"), nodequeue: workqueue.newnamedratelimitingqueue(workqueue.defaultcontrollerratelimiter(), "node"), machineclassqueue: workqueue.newnamedratelimitingqueue(workqueue.defaultcontrollerratelimiter(), "machineclass"), machinequeue: workqueue.newnamedratelimitingqueue(workqueue.defaultcontrollerratelimiter(), "machine"), machinesafetyorphanvmsqueue: workqueue.newnamedratelimitingqueue(workqueue.defaultcontrollerratelimiter(), "machinesafetyorphanvms"), machinesafetyapiserverqueue: workqueue.newnamedratelimitingqueue(workqueue.defaultcontrollerratelimiter(), "machinesafetyapiserver"), safetyoptions: safetyoptions, nodeconditions: nodeconditions, driver: driver, bootstraptokenauthextragroups: bootstraptokenauthextragroups, volumeattachmenthandler: nil, permitgiver: permits.newpermitgiver(permitgiverstaleentrytimeout, janitorfreq), } 1.2 assign listers and hassynced funcs to controller struct // initialize controller listers from the passed-in shared informers (8 listers) controller.pvclister = pvcinformer controller.pvlister = pvinformer.lister() controller.machinelister = machineinformer.lister() // etc // assign the hassynced function from the passed-in shared informers controller.pvcsynced = pvcinformer.informer().hassynced controller.pvsynced = pvinformer.informer().hassynced controller.machinesynced = machineinformer.informer().hassynced 1.3 register controller event handlers on informers. an informer invokes registered event handler when a k8s object changes. event handlers are registered using <type>informer().addeventhandler(reso