} 1. wait for informer caches to sync when an informer starts, it will build a cache of all resources it currently watches which is lost when the application restarts. this means that on startup, each of your handler functions will be invoked as the initial state is built. if this is not desirable for your use case, you can wait until the caches are synced before performing any updates using the cache.waitforcachesync function: if !cache.waitforcachesync(stopch, c.secretsynced, c.pvcsynced, c.pvsynced, c.pdbsynced, c.volumeattachementsynced, c.nodesynced, c.machineclasssynced, c.machinesynced) { runtimeutil.handleerror(fmt.errorf("timed out waiting for caches to sync")) return
} 2. register metrics the controller struct implements the prometheus.collector interface and can therefore be registered on prometheus metrics registry. collectors which are added to the registry will collect metrics to expose them via the metrics endpoint of the mcm every time when the endpoint is called. prometheus.mustregister(c) 2.1 controller.describe all promethueus.metric that are collected must first be described using a prometheus.desc which is the meta-data about a metric. as can be seen below the machine controller sends a description of metrics.machinecountdesc to prometheus. this is mcm_machine_items_total which is the count of machines managed by controller. doubt: we currently appear to have only have one metric for the mc ? var machinecountdesc = prometheus.newdesc("mcm_machine_items_total", "count of machines currently managed by the mcm.", nil, nil) func (c *controller) describe(ch chan<- *prometheus.desc) { ch <- metrics.machinecountdesc
} 2.1 controller.collect collect is called by the prometheus registry when collecting metrics. the implementation sends each collected metric via the provided channel and returns once the last metric has been sent. the descriptor of each sent metric is one of those returned by describe todo: describe each of the collect methods. // collect is method required to implement the prometheus.collect interface.
func (c *controller) collect(ch chan<- prometheus.metric) { c.collectmachinemetrics(ch) //c.collectmachinesetmetrics(ch) //c.collectmachinedeploymentmetrics(ch) c.collectmachinecontrollerfrozenstatus(ch)
} 3. create controller worker go-routines applying reconciliations func (c *controller) run(workers int, stopch <-chan struct{}) { //.. 3 waitgroup sync.waitgroup for i := 0; i < workers; i++ { createworker(c.secretqueue, "clustersecret", maxretries, true, c.reconcileclustersecretkey, stopch, &waitgroup) createworker(c.machineclassqueue, "clustermachineclass", maxretries, true, c.reconcileclustermachineclasskey, stopch, &waitgroup) createworker(c.nodequeue, "clusternode", maxretries, true, c.reconcileclusternodekey, stopch, &waitgroup) createworker(c.machinequeue, "clustermachine", maxretries, true, c.reconcileclustermachinekey, stopch, &waitgroup createworker(c.machinesafetyorphanvmsqueue, "clustermachinesafetyorphanvms", maxretries, true, c.reconcileclustermachinesafetyorphanvms, stopch, &waitgroup) createworker(c.machinesafetyapiserverqueue, "clustermachineapiserver", maxretries, true, c.reconcileclustermachinesafetyapiserver, stopch, &waitgroup) } <-stopch waitgroup.wait()
} 3.1 createworker createworker creates and runs a go-routine that just processes items in the specified queue. the worker will run until stopch is closed. the worker will be added to the wait group when started and marked done when finished. func createworker(queue workqueue.ratelimitinginterface, resourcetype string, maxretries int, forgetaftersuccess bool, reconciler func(key string) error, stopch <-chan struct{}, waitgroup *sync.waitgroup) { waitgroup.add(1) go func() { wait.until(worker(queue, resourcetype, maxretries, forgetaftersuccess, reconciler), time.second, stopch) waitgroup.done() }()
} worker returns a function that de-queues items (keys) from the work queue. the keys that are obtained using work queue.get to be strings of the form namespace/name of the resource. processes them by invoking the reconciler(key) function the purpose of the reconciler is to compares the actual state with the desired state, and attempts to converge the two. it should then update the status block of the resource. if reconciler returns an error, requeue the item up to maxretries before giving up. marks items as done. then we execute the reconciler. func worker(queue workqueue.ratelimitinginterface, resourcetype string, maxretries int, forgetaftersuccess bool, reconciler func(key string) error) func() { return func() { exit := false for !exit { exit = func() bool { key, quit := queue.get() if quit { return true } defer queue.done(key) err := reconciler(key.(string)) if err == nil { if forgetaftersuccess { // always true for mc queue.forget(key) } return false } if queue.numrequeues(key) < maxretries { queue.addratelimited(key) return false } queue.forget(key) return false }() } }
} 4. reconciliation functions executed by worker the controller starts worker go-routines that pop out keys from the relevant workqueue and execute the reconcile function. See reconcile chapters.

