k8s.io/api/core/v1.Node represents a worker node in Kubernetes. type Node struct { metav1.TypeMeta metav1.ObjectMeta Spec NodeSpec // Most recently observed status of the node. Status NodeStatus
} NodeSpec k8s.io/api/core/v1.NodeSpec describes the attributes that a node is created with. Both Node and MachineSpec use this. A snippet of MCM-relevant NodeSpec struct fields shown below for convenience. type NodeSpec struct { // ID of the node assigned by the cloud provider in the format: <ProviderName>://<ProviderSpecificNodeID> ProviderID string // podCIDRs represents the IP ranges assigned to the node for usage by Pods on that node. PodCIDRs []string // Unschedulable controls node schedulability of new pods. By default, node is schedulable. Unschedulable bool // Taints represents the Node's Taints. (taint is opposite of affinity. allow a Node to repel pods as opposed to attracting them) Taints []Taint
} Node Taints See Taints and Tolerations k8s.io/api/core/v1.Taint is a Kubernetes Node property that enable specific nodes to repel pods. Tolerations are a Kubernetes Pod property that overcome this and allow a pod to be scheduled on a node with a matching taint. Instead of applying the label to a node, we apply a taint that tells a scheduler to repel Pods from this node if it does not match the taint. Only those Pods that have a toleration for the taint can be let into the node with that taint. kubectl taint nodes <node name> <taint key>=<taint value>:<taint effect> Example: kubectl taint nodes node1 gpu=nvidia:NoSchedule Users can specify any arbitrary string for the taint key and value. The taint effect defines how a tainted node reacts to a pod without appropriate toleration. It must be one of the following effects; NoSchedule: The pod will not get scheduled to the node without a matching toleration. NoExecute:This will immediately evict all the pods without the matching toleration from the node. PerferNoSchedule:This is a softer version of NoSchedule where the controller will not try to schedule a pod with the tainted node. However, it is not a strict requirement. type Taint struct { // Key of taint to be applied to a node. Key string // Value of taint corresponding to the taint key. Value string // Effect represents the effect of the taint on pods // that do not tolerate the taint. // Valid effects are NoSchedule, PreferNoSchedule and NoExecute. Effect TaintEffect // TimeAdded represents the time at which the taint was added. // It is only written for NoExecute taints. // +optional TimeAdded *metav1.Time } Example of a PodSpec with toleration below: apiVersion: v1
