tatus See godoc for k8s.io/api/policy/v1.PodDisruptionBudgetStatus Pod Volumes A k8s.io/api/core/v1.Volume represents a named volume in a pod - which is a directory that may be accessed by any container in the pod. See Pod Volumes A Volume has a Name and embeds a VolumeSource as shown below. A VolumeSource represents the location and type of the mounted volume. type Volume struct { Name string VolumeSource
